INSERT INTO `border_knowledge` VALUES ('2', '消防安全知识 - 逃生自救常识', '消防安全知识 - 逃生自救常识:1、火灾袭来时要迅速逃生，不要贪恋财物。\r\n2、家庭成员平时就要了解掌握火灾逃生的基本方法，熟悉几条逃生路线。\r\n3、受到火势威胁时，要当机立断披上浸湿的衣物、被褥等向安全出口方向冲出去。\r\n4、穿过浓烟逃生时，要尽量使身体贴近地面，并用湿毛巾捂住口鼻。\r\n5、身上着火，千万不要奔跑，可就地打滚或用厚重衣物压灭火苗。\r\n6、遇火灾不可乘坐电梯，要向安全出口方向逃生。\r\n7、室外着火，门已发烫时，千万不要开门，以防大火窜入室内。要用浸湿的被褥、衣物等堵塞门窗，并泼水降温。\r\n', '1', '2017-08-23 17:01:29', '2', '2');
INSERT INTO `border_knowledge` VALUES ('3', '消防安全知识 - 防火常识', '消防安全知识 - 防火常识:\r\n1、教育孩子不玩火，不玩弄电气设备。\r\n2、不乱丢烟头，不躺在床上吸烟。\r\n3、不乱接乱拉电线，电路熔断器切勿用铜、铁丝代替。\r\n4、家中不可存放超过　0.5公升的汽油、酒精、天那水等易燃易爆物品。\r\n5、明火照明时不离人，不要用明火照明寻找物品。\r\n6、离家或睡觉前要检查用电器具是否断电，燃气阀门是否关闭，明火是否熄灭。\r\n7、切勿在走廊、楼梯口等处堆放杂物，要保证通道和安全出口的畅通。\r\n8、发现燃气泄漏，要迅速关闭气源阀门，打开门窗通风，切勿触动电器开关和使用明火，并', '1', '2017-08-24 09:35:46', '1', '2');
