INSERT INTO `examination` VALUES ('1', '2017下半年考试通知', '根据原人事部《〈经济专业技术资格考试暂行规定〉及其〈实施办法〉的通知》（人职发〔1993〕1号）文件精神，从1993年起在全国范围内组织实施经济专业技术资格考试。为增强职业技能，提高巡防知识，现确定考试安排，请相关人员务必按时参与考试为增强职业技能，提高巡防知识，现确定考试安排，请相关人员务必按时参与.', '1', '1', '2017-08-31 10:50:40', '2017-08-31 10:50:42', '2017-09-29 10:50:45');
INSERT INTO `examination` VALUES ('2', '全国专业技术人员计算机应用能力考试', '这是一个日新月异的时代，信息技术以其不可阻挡的恢弘气势席卷了人类社会的各个领域，渗透到我们工作、学习和生活的方方面面。为了在全社会广泛应用信息技术，提高计算机和网络的普及应用程度，加强信息资源的开发和利用，落实国家加快信息化建设的要求，引导专业技术人员学习掌握计算机知识，提高计算机的应用能力，根据《人事部关于全国专业技术人员计算机应用能力考试的通知》（人发〔2001〕124号）精神，从2002年开始，在全国范围内推行专业技术人员计算机应用能力考试，并将考试成绩作为评聘专业技术职务的条件之一。', '1', '1', '2017-08-31 11:00:49', '2017-08-31 11:00:54', '2017-09-22 11:00:58');
INSERT INTO `examination` VALUES ('3', '全国翻译专业资格(水平)考试', '根据原人事部、中国外文出版发行事业局《翻译专业资格(水平)考试暂行规定》(国人部发[2003]21号)、《二级、三级翻译专业资格(水平)考试实施办法》(国人部发[2003]17号)和《关于印发〈资深翻译和一级翻译专业资格(水平)〉评价办法(试行)的通知》(人社部发[2011]51号)、文件精神设立翻译资格考试，首次考试于2003年12月开始进行。', '1', '1', '2017-08-31 11:01:22', '2017-08-31 11:01:26', '2017-08-31 11:01:28');
INSERT INTO `examination` VALUES ('4', '咨询工程师考试', '根据原人事部、国家发展计划委员会《人事部、国家发展计划委员会关于印发〈注册咨询工程师(投资)执业资格制度暂行规定〉和〈注册咨询工程师(投资)执业资格考试实施办法〉的通知》(人发〔2001〕127号)文件精神，从2002年起在全国范围内组织实施咨询工程师考试。', '1', '1', '2017-08-31 11:01:51', '2017-08-31 11:01:55', '2017-09-09 11:01:57');
INSERT INTO `examination` VALUES ('5', '注册资产评估师执业资格考试', '根据原人事部、国家国有资产管理局《关于印发<注册资产评估师执业资格制度暂行规定>及<注册资产评估师执业资格考试实施办法>的通知》(人职发[1995]54号)文件精神，从1996年起在全国范围内组织实施注册资产评估师执业资格考试。', '1', '1', '2017-08-31 11:02:18', '2017-08-31 11:02:22', '2017-10-07 11:02:35');
