INSERT INTO `notice` VALUES ('13', '自治区政府办公厅部分党支部到我县开展主题党日活动', '&lt;p style=&quot;text-indent:28px&quot;&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;为加强党员培训和党性锻炼，提高党性修养，推进&ldquo;两学一做&rdquo;学习教育常态化、制度化，促进支部党员不忘初心，牢记党的宗旨，争做合格党员，&lt;/span&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;6&lt;/span&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;月&lt;/span&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;29&lt;/span&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;日&lt;/span&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;，在党的&lt;/span&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;96&lt;/span&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;岁&ldquo;生日&rdquo;即将到来之际，自治区人民政府办公厅副秘书长唐宁率自治区人民政府办公厅第三秘书处、行政处、财务处和离退处&lt;/span&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;个党支部到我县开展主题党日活动。县委常委、组织部部长谢国志参加活动。&lt;/span&gt; &lt;/p&gt;&lt;p style=&quot;text-indent:28px&quot;&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;当天，唐宁一行首先来到龙州起义纪念馆进行参观，瞻仰革命烈士，向革命先烈敬献花篮，并温入党誓词，牢记初心，保持对党的忠诚。随后，唐宁一行来到红八军军部旧址、胡志明展馆，进一步深入体会龙州红色革命历史情怀。&lt;/span&gt; &lt;/p&gt;&lt;p style=&quot;text-indent:28px&quot;&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;在座谈会上，副县长李峥玄介绍了我县基本情况。自治区党支部与会人员结合自身工作实际，纷纷交流了参观感想。&lt;/span&gt; &lt;/p&gt;&lt;p style=&quot;text-indent:28px&quot;&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;唐宁指出，龙州是一座历史悠久的红色文化名城，具有独特的边关口岸、自然条件地理和资源优势，此次主题党日活动给各支部党员带来深刻体会，希望各党员要坚定信念，&ldquo;忙而不茫&rdquo;，保持对党、对国家、对事业、对人民的忠诚，为党的事业发展奉献力量；作为新时代的党员，要主动学习新知识，在工作上下功夫，更要在提高工作水平、服务水平上下大功夫，不忘初心，增强党性修养，提升内心尺度，提高个人素养。&lt;/span&gt; &lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: SimSun&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; 当天，唐宁一行还来到县老年大学党支部副书记刘生兴家中开展慰问活动，为老党员刘生兴送上慰问品及慰问金，向他致以节日的问候和祝福。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '0', '新闻中心', '7', null, '2017-07-06 13:36:51', '2017-07-06 13:36:42', '2');
INSERT INTO `notice` VALUES ('41', '专题学习会', '&lt;h1 style=&quot;padding: 0px; margin: 0px; list-style: none; font-family: 黑体; font-size: 24px; text-align: center; line-height: 35px; font-weight: normal; white-space: normal; background-color: rgb(249, 251, 250);&quot;&gt;我市各部门举行学习贯彻习近平总书记&ldquo;7&middot;26&rdquo;重要讲话精神专题学习会&lt;/h1&gt;&lt;h2 style=&quot;padding: 0px; margin: 0px; list-style: none; font-family: 黑体; font-size: 22px; text-align: center; line-height: 35px; font-weight: normal; white-space: normal; background-color: rgb(249, 251, 250);&quot;&gt;&lt;/h2&gt;&lt;h3 style=&quot;padding: 0px; margin: 0px; list-style: none; font-size: 20px; text-align: center; line-height: 35px; font-weight: normal; font-family: &quot;&gt;&lt;/h3&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; font-size: 12pt; line-height: 28px;&quot;&gt;　　&lt;span style=&quot;padding: 0px; margin: 0px; list-style: none; font-size: 12pt; line-height: 28px;&quot;&gt;连日来，我市各部门纷纷举行专题学习会，传达学习习近平总书记在省部级主要领导干部&ldquo;学习习近平总书记重要讲话精神，迎接党的十九大&rdquo;专题研讨班上的重要讲话精神，牢固树立&ldquo;四个意识&rdquo;，扎实做好当前工作，以优异成绩迎接党的十九大胜利召开。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; font-size: 12pt; line-height: 28px;&quot;&gt;　　&lt;strong style=&quot;padding: 0px; margin: 0px; list-style: none; line-height: 28px;&quot;&gt;市纪委&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; font-size: 12pt; line-height: 28px;&quot;&gt;　　7月31日，市纪委理论学习中心组举行专题学习会。会议指出，全市纪检监察机关要带头落实，把学习贯彻习近平总书记在专题研讨班上的重要讲话精神作为当前一项重要政治任务抓好抓实。广大纪检监察干部要认真学习，深刻领会，切实把思想和行动统一到习近平总书记重要讲话精神上来。要结合&ldquo;两学一做&rdquo;学习教育常态化制度化，迅速掀起学习贯彻习近平总书记重要讲话精神的热潮。&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; font-size: 12pt; line-height: 28px;&quot;&gt;　　会议强调，要以习近平总书记重要讲话精神为引领，坚定不移地推动全面从严治党向纵深发展。一要迅速行动，及时部署学习；二要严明政治纪律，维护好中央权威；三要狠抓重点工作，当好政治生态的&ldquo;护林员&rdquo;；四要围绕党的十九大召开，维护好社会稳定和谐。着力营造风清气正的政治生态和干事创业的良好环境，以优异成绩迎接党的十九大胜利召开。&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; font-size: 12pt; line-height: 28px;&quot;&gt;　　市委常委、市纪委书记王祝广主持会议并讲话。&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; font-size: 12pt; line-height: 28px;&quot;&gt;　　&lt;strong style=&quot;padding: 0px; margin: 0px; list-style: none; line-height: 28px;&quot;&gt;市委宣传部&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; font-size: 12pt; line-height: 28px;&quot;&gt;　　8月1日，市委宣传部理论学习中心组召开专题集中学习扩大会，深入学习习近平总书记在省部级领导干部专题研讨班开班式上的重要讲话精神，学习传达全国宣传部长专题会议和全区宣传思想文化系统专题工作会议精神。&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; font-size: 12pt; line-height: 28px;&quot;&gt;　　会议强调，习近平总书记&ldquo;7&middot;26&rdquo;重要讲话，提出了一系列新的重要思想、重要观点、重大判断、重大举措，是激励我们把中国特色社会主义事业推向前进的政治宣言，要认真学习领会，准确把握讲话精神的精神实质和丰富内涵。要以高度的政治责任感使命感，切实抓好讲话精神的宣传解读，把学习讲话精神作为当前我市理论武装工作的重点任务，精心策划新闻宣传，报道各县区各部门各单位学习贯彻落实讲话精神的实际行动和具体举措，统筹抓好网上网下宣传，引导广大党员干部群众切实把思想和行动统一到讲话精神上来，为党的十九大胜利召开营造良好的舆论氛围。要按照自治区党委宣传部和市委的统一决策部署，切实抓好意识形态和宣传思想工作，以更高的政治自觉深化习近平总书记系列重要讲话精神学习宣传，以更加丰富的形式宣传党的十八大以来的非凡历程与辉煌成就，以更多元的载体将社会主义核心价值观融入社会生活，以优异的成绩迎接党的十九大胜利召开。&lt;/p&gt;&lt;p&gt;发布日期：2017-08-02 &amp;nbsp;&amp;nbsp;来源：南宁日报 &amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;br/&gt;字体颜色：【&amp;nbsp;&lt;a style=&quot;white-space: normal; padding: 0px; margin: 0px; list-style: none;&quot;&gt;红&lt;/a&gt;&amp;nbsp;&amp;nbsp;&lt;a style=&quot;white-space: normal; padding: 0px; margin: 0px; list-style: none;&quot;&gt;黄&lt;/a&gt;&amp;nbsp;&amp;nbsp;&lt;a style=&quot;white-space: normal; padding: 0px; margin: 0px; list-style: none;&quot;&gt;蓝&lt;/a&gt;&amp;nbsp;&amp;nbsp;&lt;a style=&quot;white-space: normal; padding: 0px; margin: 0px; list-style: none;&quot;&gt;绿&lt;/a&gt;】 &amp;nbsp;&amp;nbsp; 字体大小：【&amp;nbsp;&lt;a style=&quot;white-space: normal; padding: 0px; margin: 0px; list-style: none;&quot;&gt;小&lt;/a&gt;&amp;nbsp;&lt;a style=&quot;white-space: normal; padding: 0px; margin: 0px; list-style: none;&quot;&gt;中&lt;/a&gt;&amp;nbsp;&lt;a style=&quot;white-space: normal; padding: 0px; margin: 0px; list-style: none;&quot;&gt;大&lt;/a&gt;】 &amp;nbsp;&amp;nbsp; 保护视力色：&amp;nbsp;&lt;a title=&quot;青山不老&quot; style=&quot;white-space: normal; padding: 0px; margin: 0px; list-style: none;&quot;&gt;青&lt;/a&gt;&amp;nbsp;&lt;a title=&quot;蓝色回忆&quot; style=&quot;white-space: normal; padding: 0px; margin: 0px; list-style: none;&quot;&gt;蓝&lt;/a&gt;&amp;nbsp;&lt;a title=&quot;明黄清俊&quot; style=&quot;white-space: normal; padding: 0px; margin: 0px; list-style: none;&quot;&gt;黄&lt;/a&gt;&amp;nbsp;&lt;a title=&quot;灰色世界&quot; style=&quot;white-space: normal; padding: 0px; margin: 0px; list-style: none;&quot;&gt;灰&lt;/a&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;span class=&quot;default&quot; style=&quot;padding: 0px; margin: 0px; list-style: none;&quot;&gt;恢复默认&lt;/span&gt;&lt;/p&gt;', '1', '广西边海防', '7', null, '2017-08-02 16:58:52', '2017-08-02 16:59:10', '2');
