INSERT INTO `notice` VALUES ('45', '重要公告', '<p style=\"font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255); margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, Arial, Verdana, Tahoma, sans-serif; text-align: center;\"><span style=\"font-size: 16px; padding: 0px; font-family: &quot;Microsoft Yahei&quot;;\">2017年第</span><span style=\"font-size: 16px; padding: 0px; font-family: &quot;Microsoft Yahei&quot;;\">18</span><span style=\"font-size: 16px; padding: 0px; font-family: &quot;Microsoft Yahei&quot;;\">号</span></p><p style=\"font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255); margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, Arial, Verdana, Tahoma, sans-serif;\"><span style=\"font-size: 16px; padding: 0px; font-family: &quot;Microsoft Yahei&quot;;\">&nbsp;</span></p><p style=\"font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255); margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, Arial, Verdana, Tahoma, sans-serif; text-indent: 42px;\"><span style=\"font-size: 16px; padding: 0px; font-family: &quot;Microsoft Yahei&quot;;\">一、2017年5月31日，我县缉私部门在旧武装部停车场附近查获涉嫌走私鸡脚一批</span></p><p style=\"font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255); margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, Arial, Verdana, Tahoma, sans-serif; text-indent: 42px;\"><span style=\"font-size: 16px; padding: 0px; font-family: &quot;Microsoft Yahei&quot;;\">二、2017年5月31日，我县缉私部门在旧武装部停车场附近查获涉嫌走私牛肉一批</span></p><p style=\"font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255); margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, Arial, Verdana, Tahoma, sans-serif; text-indent: 42px;\"><span style=\"font-size: 16px; padding: 0px; font-family: &quot;Microsoft Yahei&quot;;\">三、2017年5月31日，我县缉私部门在